import { Grid ,Container} from '@mui/material'
import CLOSEDBOOK from './completedReading';
import MyCard from '../molecules/MyCard';
interface Props{
  changeTab(val:number): any
  searchTerm:string
}

interface BookType{
  id:number,
  src:string,
  name:string,
  author:string,
  duration:string,
  noOfReads?:string,
}

const finishedBooksData=`{"books":[{"id":11,"src":"being-boss.png","name":"Being Boss", "author":"Kathleen Shannon and Emily..." , "duration":"13"}] }`
const data= JSON.parse(finishedBooksData);
const finishedBooks= data.books;
console.log("finished reading books:")
console.log(finishedBooksData) 

function FinishedBooks(props:Props){
    return (
      <Container style={{paddingLeft:"7%",paddingRight:"7%"}}>
      <Grid container rowSpacing={2} spacing={4}>
      { finishedBooks.filter((val:any)=>{
      if(props.searchTerm === "")
        return val 
      else if (val.name.toLowerCase().includes(props.searchTerm.toLowerCase()) 
      || val.author.toLowerCase().includes(props.searchTerm.toLowerCase())){
        return val
      }}).map((book:BookType) =><Grid item xs={12} sm={6} md={4}> <MyCard  changeTab={props.changeTab} 
      progressBar='half' button='Finished'
      id={book.id} key={book.id} src={book.src} name={book.name}
      author={book.author} duration={book.duration} noOfReads={book.noOfReads}/>
       </Grid> )} 
      </Grid>
      </Container>
    );
}
export default FinishedBooks;

